const img=''
let params={
    app_id:'2108129412',
    decoration:1,
    image:img,
    nonce_str:Math.random().toString(),
    time_stamp:new Date().getTime()/1000
}
/*for (let key of Object.keys(params)) {
    params[key]=encodeURI(params[key]).toUpperCase()
}*/
let str=querystring.stringify(params)+'&app_key='+app_key

let sign= md5.update(str).digest('hex').toUpperCase();
params.sign=sign

//console.log('par',qs.stringify(params))
axios.post('https://api.ai.qq.com/fcgi-bin/ptu/ptu_facedecoration',
    qs.stringify(params),{
    headers: {
        'Content-Type': 'application/x-www-form-urlencoded'
    }
}).then((res)=>{
    if(res.data.ret==0){

        let image=res.data.data.image
        var dataBuffer = new Buffer(image, 'base64');
        fs.writeFile('./static/images/'+"face.jpg", dataBuffer, function(err) {
            if(err){
                console.log(err);
            }else{
                console.log("保存成功！");
            }
        });
    }


}).catch(e=>{
    console.log('e',e)
})